import React from "react";
const ReturnHome = () => {
  navigate("/");
};
const PageError = () => {
  return (
    <>
    <div className="PageError">
      <h1>404</h1>
      <h2>Page not found</h2>
    </div>

<div className="center">
<button class="button" onClick={ReturnHome}>
  BACK <i class="fas fa-angle-double-left"></i>
</button>
</div>
    </>
  );
};

export default PageError;
